  useGSAP(() => {
    const ids = [
      "Rectangle_31677",
      "Rectangle_31679",
      "Rectangle_31681",
      "Rectangle_31683",
      "Rectangle_31682",
      "Rectangle_31678",
      "Rectangle_31680",
    ];

    // Scroll animation for all rectangles
    ids.forEach((id) => {
      gsap.from(`#${id}`, {
        y: -10,
        duration: 1,
        delay: 0.5,
        ease: "power2.inOut",
        // scrollTrigger: {
        //   trigger: "#Logos",
        //   start: "top 80%",
        //   end: "bottom 50%",
        //   scrub: 1,
        //   once: false,
        // },
      });
    });

    // 3D hover animation for all rectangles
    ids.forEach((id) => {
      const rectangle = document.querySelector(`#${id}`);

      const handleMouseEnter = () => {
        gsap.to(`#${id}`, {
          x: 10, // Move along X-axis
          y: 10, // Move along Y-axis
          z: 10, // Move along Z-axis
          duration: 0.5,
          ease: "power2.out",
        });
      };

      const handleMouseLeave = () => {
        gsap.to(`#${id}`, {
          x: 0,
          y: 0,
          z: 0, // Reset Z-axis
          duration: 0.5,
          ease: "power2.inOut",
        });
      };

      // Add event listeners
      rectangle.addEventListener("mouseenter", handleMouseEnter);
      rectangle.addEventListener("mouseleave", handleMouseLeave);

      // Cleanup event listeners on component unmount
      return () => {
        rectangle.removeEventListener("mouseenter", handleMouseEnter);
        rectangle.removeEventListener("mouseleave", handleMouseLeave);
      };
    });
  }, []);

